import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { increment } from './redux/Slices/cartSlices';

const App = () => {
  const c = useSelector((state)=>state.cartSlic.value)
  const d = useDispatch();
  return (
    <div className='w-[100vw] h-[100vh] flex justify-center items-center bg-cyan-200'>
     {c}
     <button onClick={()=>d(increment())}>
      click
     </button>
    </div>
  )}

export default App
